import React from 'react';
/* Still links to app.css! No need for a separate import */



function Project(props) { /* props is passed from App.js and is an all-in-one arg */
    return(
        <div className="Project-Component">
            <div className="nested-div">
                <h2 style={{ textDecorationLine: 'overline' }} >{props.projectName}</h2>
                <p>Tech: {props.technologies} [Icon] [Icon] [Icon] [Icon] </p>
                <p>Project Blurb: {props.blurb}</p>
                <p>Need to get this prop into button link: {props.git}...{props.gitLink}</p>
                {/* need buttons for visiting the live site, git, and seeing image? */}
                <button className="github-button" onClick={toGitHub}>To GitHub</button>
            </div>
        </div>
    );
}

/* Pass in args specifying which github page to go to? */
function toGitHub(props) { /* have to have way to tell local link which weblink */
  const gitHubLink = props.gitLink; /* template literal here for name of id? */
  console.log(gitHubLink)
  window.open(
    `https://github.com/jstearne/${gitHubLink}`, "_blank"); // need link to be specific for site
}

/* Must contain: Header/Title, Technical Skills List, About Me Blurb (nav bar component?) */
export default Project;


